    public static string Order_PlaceUnder_I00_Nullbehaelter_485
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "\"Oh, guck mal, ein Vögelchen!\" lenkte ich den Hippie meisterhaft ab. Und tatsächlich blickte er zum Himmel.<br>Unauffällig schob ich ihm die Raupe unter den Pullower.<br>Wenig später wollte sich der Hippie die nächste Portion Kopfnuss genehmigen, aber als er die Nuss rausholte, schlug die allergische Raupe zu und der Hippie musste schrecklich niesen. Dabei pustete er versehentlich die Nuss davon, welche daraufhin in einem erschreckend hohen Bogen in Richtung des Dschungels davonflog.<br>\"Verdammt!\" fluchte der Hippie.<br>Zum Glück war ihm bei dieser Aktion die Raupe aus dem Pullover gefallen. Ich sah, wie sie eilig Richtung Dschungel davonkroch.";
            else
                return "\"Oh, look, a little bird!\" I distracted the hippie masterfully. And in fact he looked to the sky.<br>Unobtrusively I pushed him the caterpillar under the Pullower.<br>A little later, the hippie wanted to approve the next portion of head nut, but when he took out the nut, the allergic caterpillar struck and the hippie had to sneeze terribly. In doing so, he accidentally blew the nut away, which then flew off in a frighteningly high arc in the direction of the jungle.<br>\"Damn!\" cursed the hippie.<br> Luckily, the caterpillar had fallen out of his sweater during this action. I saw how she hurriedly crawled away in the direction of the jungle.";
        }
    }
