    public static string Order_SpitOnP_Person_Everyone_778
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "\"Was machst du da oben?\" brüllte die mopsige Wache und starrte mich wütend an.<br>\"Nichts, nichts. Ich arbeite nur an meiner feuchten Aussprache.\"<br>\"Sehr witzig\", knurrte die Wache. \"Jetzt muss ich dich leider verhaften. Kommst du freiwillig runter oder muss ich dich holen?\"<br>\"Och, es ist eigentlich ganz schön hier oben\", säuselte ich.<br>\"Denkst du vielleicht auch mal an meine Knieprobleme? Hey, ich bin adipös, ich kann wirklich nicht gut Treppen steigen. Komm schon, du hast dich heute wirklich schon genug als schlechter Mensch präsentiert. Möchtest du nicht einfach mal wieder eine gute Seite von dir zeigen?\"<br>Ach, wie unangenehm, dass er auch noch recht hatte. \"Ich mach ja schon.\"<br>Kurz darauf sperrte mich die Wache unter dem irren Blick des Ghuls in meine gute alte Zelle.";
            else
                return "\"What are you doing up there?\" roared the corpulent guard, glaring angrily at me.<br>\"Nothing, nothing. I'm just working on my wet pronunciation.\"<br>\"Very funny,\" growled the guard. \"I'm sorry, but I have to arrest you. Are you coming down voluntarily or do I have to come and get you?\"<br>\"Oh, it's actually quite nice up here\", I purred.<br>\"Do you ever think about my knee problems? Hey, I'm obese, I'm really not good at climbing stairs. Come on, you've really presented yourself as a bad person enough today. Don't you just want to show a good side of yourself again?\"<br>Oh, how unpleasant that he was also right. \"I'll do it.\"<br>Shortly thereafter, the guard locked me in my good old cell under the crazy gaze of the ghoul.";
        }
    }
