    public static string Order_Press_Person_Everyone_1113
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Ich drückte auf die Klingel. Nach kurzer Zeit erschien ein junger Mann an der Tür und blickte mich misstrauisch an. \"Könnte ich dich kurz sprechen? Ich habe ein paar Fragen!\" fragte ich mit einer möglichst ehrfurchtsgebietenden Stimme.<br>Er starrte mich aus angstvoll aufgerissenen Augen an. \"Äh ja, das ist eigentlich Ludmillas Haus, aber... es spricht glaube ich nichts dagegen, dass ich dich hereinlasse. Ich meine... ich kann sie momentan nicht fragen... komm rein!\"<br>Ich ging hinter ihm ins Haus.<br>Mehr als verwirrt folgte ich der Aufforderung und betrat den vergleichsweise luxuriösen Wohnbereich.<br>Als Erstes stach mir hier die halb mumifizierte Leiche ins Auge, die auf dem Sofa saß.<br>Moment... eine Leiche?";
            else
                return "I pressed the bell. After a short time, a young man appeared at the door and looked at me suspiciously. \"Could I speak to you for a moment? I have a few questions!\" I asked in as awe-inspiring a voice as possible.<br>He stared at me from eyes wide with fear. \"Uh yes, this is actually Ludmilla's house, but.... I don't think there's anything wrong with me letting you in. I mean... I can't ask her right now... come in!\"<br>I walked behind him into the house.<br> More than confused, I followed the invitation and entered the comparatively luxurious living area.<br> The first thing that caught my eye here was the half-mummified corpse sitting on the sofa.<br> Moment... a corpse?";
        }
    }
