                return "Ich sah, wie die Ratte den Balken hochkletterte und sich mit atemberaubender Geschwindigkeit der entisolierten Stelle näherte. Oh mein Gott, was hatte ich getan!<br>Ich schrie: \"Neeeeeeiiiin!\", aber die Ratte flitzte nur noch schneller und erreichte dann die blanke Stelle. Es britzelte kurz, dann fiel die Ratte tot vom Balken und landete nicht weit entfernt vor mir auf dem Boden.";
