    public static string Order_Press_Person_Everyone_1120
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Ich drückte auf die Klingel. Nach kurzer Zeit erschien ein junger Mann an der Tür und blickte mich misstrauisch an. \"Könnte ich dich kurz sprechen? Ich habe ein paar Fragen!\" fragte ich mit einer möglichst ehrfurchtsgebietenden Stimme.<br>Er starrte mich aus angstvoll aufgerissenen Augen an. \"Äh ja, ich glaube nicht, dass Ludmilla etwas dagegen hat. Auch wenn sie momentan nicht so gerne Besuch empfängt. Komm rein.\"<br>Voller böser Ahnungen folgte ich der Aufforderung und ging hinter ihm ins Haus.<br>Und tatsächlich trafen meine schlimmsten Befürchtungen ein.<br>Wieder saß Ludmilla auf der Couch, starrte mich aus Augen an, die mühsam in den auseinanderfallenden, modernden Körper gestopft schienen. Aber im Gegensatz zu unserer Begegnung ohne Phoneyvision war sie nun \"lebendig\" und bewegte ihren auseinander fallenden Körper ruckhaft hin und her.";
