    public static string Order_Climb_I1_51_Fahndungsplakate_1328
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Todesmutig quetschte ich mich durch das breite Klo, das zum Glück seit seiner Neueröffnung noch nicht verwendet worden zu sein schien. Die breite Röhre schien sich endlos hinzuziehen, aber schließlich plumpste ich in den Burggraben. Hastig kletterte ich aus dem Wasser, bevor die Krokodile mir zu nahe kommen konnten.";
            else
                return "Death-defyingly, I squeezed through the wide toilet, which fortunately didn't seem to have been used since its reopening. The wide tube seemed to drag on endlessly, but finally I plopped into the moat. Hastily, I climbed out of the water before the crocodiles could get too close.";
        }
    }
    public static string Order_Climb_I1_51_Fahndungsplakate_1329
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Bah, was war das nur für eine ekelhafte Erfahrung gewesen. Aber was passierte plötzlich mit mir? Die Wirklichkeit vor mir verschwamm und langsam schimmerte Phoneyvision hindurch. Bald war die gesamte Wirklichkeit verschwunden.<br>Dummerweise hatte ich auch keinen Golfball mehr, um zwischen den Realitätsebenen zu wechseln. Hatte dieser Mistkerl am Ende doch noch gewonnen?<br>Oh mein Gott.";
            else
                return "Bah, what a disgusting experience that had been. But what happened to me all of a sudden? The reality in front of me blurred and slowly Phoneyvision shimmered through. Soon all reality had disappeared.<br>Stupidly, I also no longer had a golf ball to switch between reality levels. Had that bastard won in the end after all?<br>Oh my God.";
        }
    }
    public static string Order_Climb_I1_24_Kellertuer_1330
