    }
    public static string Order_Climb_I1_24_Kellertuer_1331
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Ich stand vor [I:I1_29_Satanspalast]einem schwarzen Satanspalast[/I], der mit [I:I1_29_Daemonentor]einem durch und durch abscheulichen Dämonentor[/I] verschlossen war. Rings um den Palast befand sich [I:I1_29_Faeulnis]rabenschwarze, teuflische Fäulnis[/I], die ich auf keinen Fall berühren wollte. Etwas abseits unter den Bäumen befand sich [I:I1_29_Verschlag]ein kleiner Verschlag[/I], der schon reichlich baufällig aussah. [L:L1_28_Dichter_Wald]Ein breiter Weg führte von hier nach Nordosten zurück in den dichten Wald[/L]. [L:L1_44_Lichtung_Wald]In südöstlicher Richtung verlief ein Trampelpfad[/L].";
            else
                return "I stood in front of [I:I1_29_Satanspalast]a black Satan's palace[/I], which was closed with [I:I1_29_Daemonentor]a thoroughly abominable demon's gate[/I]. All around the palace was [I:I1_29_Faeulnis]pitch black, diabolical rot[/I], which I certainly did not want to touch. Somewhat off to the side under the trees was [I:I1_29_Verschlag]a small shack[/I] that already looked plenty dilapidated. [L:L1_28_Dichter_Wald]A wide path led from here to Northeast back into the dense forest[/L]. [L:L1_44_Lichtung_Wald]In southeast direction ran a trail[/L].";
        }
    }
