    public static string Order_Climb_Person_Papagei_PV1_1333
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "<br/>Verstört blickte ich mich um. Überall hingen Fahndungsplakate und Sirenen drangen an mein Ohr. Es klang fast so, als sei eine umfassende Fahndung gegen mich im Gange. Glücklicherweise war aber kein Mensch zu sehen, geschweige denn eine Wache, die mich verhaften wollte.<br/>";
            else
                return "<br/>Disturbed, I looked around. Everywhere hung wanted posters and sirens penetrated to my ear. It sounded almost as if a comprehensive manhunt was underway against me. Fortunately, however, no human being was to be seen, let alone a guard who wanted to arrest me.<br/>";
        }
    }
    public static string Order_Climb_Person_Papagei_PV1_1334
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Ich überlegte, was ich als nächstes tun sollte. Eigentlich lag der nächste Schritt auf der Hand: Nachdem ich in der Burg komplett verschissen hatte, könnte ich mich ja vielleicht bei der Ex-Königin wieder blicken lassen. Diese klitzekleinen Meinungsverschiedenheiten wegen der Kampagne würde sie mir ja sicherlich verzeihen. Ich meine, warum sollte sie schon nachtragend sein, nur weil ich Lügen verbreitet und den Rest ihres guten Rufes zerstört hatte? Doch, ich war mir sicher, sie würde sich freuen, ein Bündnis mit mir einzugehen.<br>Und bei der Gelegenheit würde sich hoffentlich auch das Problem der Phoneyvision lösen.";
            else
                return "I thought about what I should do next. Actually, the next step was obvious: After I had completely screwed up in the castle, I could perhaps show my face to the ex-queen again. I'm sure she'd forgive me for this tiny little disagreement about the campaign. I mean, why should she hold a grudge just because I had spread lies and destroyed the rest of her good reputation? But, I was sure, she would be happy to enter into an alliance with me.<br>And at the opportunity, hopefully, the problem of the Phoneyvision would also be solved.";
        }
    }
    public static string Order_Climb_Person_Episode4_Rundgang
