    public static string Adv_Adv_2237
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Aus sicherer Quelle hatte ich erfahren, dass Phoneys Angeberkarre an diesem abgelegenen Ort in den Bergen stand. Ich war sofort aufgebrochen, denn dieser Irre gehörte dringend eingesperrt, bevor er weiteren Schaden anrichtete. Und das auf ihn ausgesetzte Kopfgeld war ordentlich. <br>";
            else
                return "I had learned from a reliable source that Phoney's show-off car was parked in this remote place in the mountains. I had left immediately, because this lunatic urgently needed to be locked up before he did any more damage. And the bounty on his head was decent. <br>";
        }
    }
    public static string Adv_Adv_2238
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Mein Instinkt sagte mir, dass ich auf einer verdammt heißen Spur war. Ich mahnte mich, vorsichtig zu sein. Den Spitznamen Phoney hatte er sich mehr als verdient. Der Mann war ein Großmeister darin, Menschen zu manipulieren und für seine Zwecke einzuspannen. Besser, ich war auf jede Schandtat gefasst.<br/><br/>";
            else
                return "My instincts told me I was on a damn hot streak. I reminded myself to be careful. He had more than earned the nickname Phoney. The man was a grandmaster at manipulating people and using them for his own purposes. Better, I was ready for any outrage.<br/><br/>";
        }
    }
    public static string Adv_Adv_2239
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Es war sonnenklar, was es hier für mich zu tun gab: Wenn Phoney hier war, musste ich ihn finden. Ich konnte es gar nicht erwarten, ihm die Handschellen um die Handgelenke zu legen. Hoffentlich war das Haus nicht so baufällig, wie es aussah.<br/><br/><br/>    ";
            else
                return "It was as clear as day what there was for me to do here: If Phoney was here, I had to find him. I couldn't wait to get the cuffs around his wrists. Hopefully the house wasn't as dilapidated as it looked.<br/><br/><br/>    ";
        }
    }
