        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Oho, ein Zwergenaufstand vor der Redaktion. Stans Rumgehampel war zwar läppisch, aber man konnte sich das Ganze doch fast vorstellen wie eine süße kleine Rebellion. Wenigstens hatte Julius jetzt Material für eine Extraausgabe.";
