    public static string Adv_DoPostbeamter_Person_I_4737
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Als ich die Mall betrat, wurde ich Zeuge einer denkwürdigen Szene.<br>Stan trat breitbeinig vor Ike. Etwas verschüchtert fragte dieser: \"Was wünschen Sie zu kaufen?\"<br>Daraufhin schnauzte Stan empört: \"Alles!\"<br>\"Alles?\" staunte Ike.<br>\"Na gut, ich drücke mich ja schon präziser aus. Alles, was Luxus verspricht. Alles, was mich für dieses elende Leben, das ich die letzten Jahre führen musste, wenigstens ein bisschen entschädigt...\" Stans Lippe zitterte vor Entrüstung. \"Kannst du das nicht verstehen? Kannst du das nicht ein bisschen verstehen?\"<br>\"Äh...\" stammelte Ike. \"Ich schau mal, was ich hinten noch auf Lager habe.\"";
            else
                return "When I entered the mall, I witnessed a memorable scene.<br>Stan stepped broad-legged in front of Ike. Somewhat intimidated, he asked: \"What do you want to buy?\"<br>Thereupon Stan snorted indignantly: \"Everything!\"<br>\"Everything?\" Ike marveled.<br>\"All right, I'll be more precise. Anything that promises luxury. Anything that will compensate me at least a little bit for this miserable life I've had to live  for the last years...\" Stan's lip trembled with indignation. \"Can't you understand that? Can't you understand that a little bit?\"<br>\"Uh...\" stammered Ike. \"I'll see what else I have in stock in the back.\"";
        }
    }
    public static string Adv_DoPostbeamter_Person_I_4738
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Kurz darauf kam wieder herein und schleifte mehrere Säcke mit Luxustand hinter sich her. \"Das hier... das kann ich versprechen... braucht kein Mensch, ist völlig überteuert, aber kann einen kurzen Moment dieses Gefühl innerer Leere betäuben!\" strahlte Ike.";
            else
                return "Shortly after, he came back in, dragging several bags of luxury trash behind him. \"This one... I can promise you... no one needs it, it's completely overpriced, but it can numb this feeling of inner emptiness for a short moment!\" beamed Ike.";
        }
    }
    public static string Adv_DoPostbeamter_Person_I_4739
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
