    public static string Adv_DoTristan_Person_I_5077
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Tristans Bier stand nach wie vor unberührt da. Plötzlich begriff ich: Das war ein dummer, dummer Fehler! Ich durfte das nicht tun! Ich griff nach dem Krug, aber in dem Moment kam mir der trunksüchtige Tristan zuvor.";
