    public static string Adv_DoTristan_Person_I_5078
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "\"Du willst mir doch wohl nicht mein Bier klauen!\" polterte er.<br>\"Aber nein, aber nein.\"<br>\"Dein Glück\", brummte er und nahm einen tiefen Schluck.<br>Im nächsten Moment traten seine Augen hervor, er stand auf, ging drei Schritte und fiel dann um wie eine gefällte deutsche Eiche.";
            else
                return "\"Surely you don't want to steal my beer!\" he rumbled.<br>\"Not at all!\"<br>\"Buy your own\", he growled and took a deep gulp.<br>The next moment his eyes bulged, he stood up, took three steps and then fell over like a felled German oak.";
        }
    }
    public static string Adv_DoTristan_Person_I_5079
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Plötzlich blickte Bonny auf. \"Ach herrje!\" stöhnte sie, als sie den toten Tristan endlich bemerkte.\"Der ist schon wieder hinüber? Ganze Arbeit, der Saufbold!\"<br><br>Mit einem tiefen Seufzer schnappte sie sich den Mixer und 10 verschiedene Alkoholflaschen. Dann machte sie sich daran, einen Drink zu mixen, schüttete die Alkoholika und diverse weitere fragwürdige Substanzen in den den Mixer, schüttelte alles kräftig durch und füllte ein Glas damit. Zufrieden betrachtete sie ihr Werk.<br>\"Für Tristan wirds reichen\", stellte sie fest.<br>Sie kam hinter dem Tresen hervor, beugte sich zu Tristans Leiche hinab und verabreichte dieser einen winzigen Schluck des Gebräus.<br>Fast sofort spuckte und hustete dieser los, und rappelte sich mühsam auf. Orientierungslos blickte er sich um.<br>\"Was war das?\" ";
            else
                return "Suddenly Bonny looked up. \"Oh my!\" she moaned when she finally noticed the dead Bob.\"He's gone again? All work, the boozer!\"<br><br>With a deep sigh, she grabbed the blender and 10 different bottles of alcohol. Then she set about mixing a drink, poured the alcoholic beverages and various other questionable substances into the blender, shook everything vigorously and filled a glass with it. She came out from behind the counter, bent down to Bob's body and gave it a tiny sip of the brew.<br> Almost immediately, Bob spat and coughed, and struggled to get up. Disoriented, he looked around.<br>\"What was that?\" ";
        }
    }
    public static string Adv_DoTristan_Person_I_5080
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "\"Ach, das übliche. Pass nächstes Mal besser auf\", sagte Bonny nur, nahm das vergiftete Bier mit und verschwand hinter dem Tresen. Nur einen Moment später stand ein frisch gezapftes, mutmaßlich unvergiftetes Bier auf dem Tresen.<br>Mir fiel auf, dass Bonny das Glas mit dem geheimnisvollen Cocktail auf dem Boden hatte stehen lassen, dort, wo die Leiche gelegen hatte. Niemand schien es weiter zu beachten.";
            else
                return "\"Oh, the usual. Better watch out next time\", was all Bonny said, taking the poisoned beer with her and disappeared behind the counter. Only a moment later, there was a freshly tapped, presumably unpoisoned beer on the counter.<br> I noticed that Bonny had left the glass with the mysterious cocktail on the floor, where the corpse had lain. No one seemed to pay any further attention to it.";
        }
    }
    public static string Adv_DoTristan_Person_I_5081
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Gähnend schaute sich Bonny den toten Tristan an.<br>\"Das dritte Mal in dieser Woche. Weiß der eigentlich, was das schon wieder kostet?\" knurrte sie genervt.<br><br>Sie schnappte sich den Mixer und 10 verschiedene Alkoholflaschen. Dann machte sie sich daran, einen Drink zu mixen, schüttete die Alkoholika und diverse weitere fragwürdige Substanzen in den den Mixer, schüttelte alles kräftig durch und füllte ein Glas damit. Zufrieden betrachtete sie ihr Werk.<br>\"Für Tristan wirds reichen\", stellte sie fest.<br>Sie kam hinter dem Tresen hervor, beugte sich zu Tristans Leiche hinab und verabreichte dieser einen winzigen Schluck des Gebräus.<br>Fast sofort spuckte und hustete dieser los, und rappelte sich mühsam auf. Orientierungslos blickte er sich um.<br>\"Was war das?\" ";
            else
                return "Yawning Bonny looked at the dead Bob.<br>\"The third time this week. Does he actually know what this costs?\" she growled annoyed.<br><br>She grabbed the blender and 10 different bottles of alcohol. Then she set about mixing a drink, poured the alcoholic beverages and various other questionable substances into the blender, shook everything vigorously and filled a glass with it. She came out from behind the counter, bent down to Bob's body and gave it a tiny sip of the brew.<br> Almost immediately, Bob spat and coughed, and struggled to get up. Disoriented, he looked around.<br>\"What was that?\" ";
        }
    }
    public static string Adv_DoTristan_Person_I_5082
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "\"Ach, das übliche. Pass nächstes Mal besser auf\" sagte Bonny nur genervt, nahm das vergiftete Bier mit und verschwand hinter dem Tresen. Nur einen Moment später stand ein frisch gezapftes, mutmaßlich unvergiftetes Bier auf dem Tresen.<br>Mir fiel auf, dass Bonny das Glas mit dem geheimnisvollen Drink auf dem Boden hatte stehen lassen, dort, wo die Leiche gelegen hatte. Niemand schien es weiter zu beachten.";
            else
                return "\"Oh, the usual. Next time you better watch out!\" Bonny said annoyed, took the poisoned beer and disappeared behind the counter. Only a moment later there was a freshly tapped, presumably unpoisoned beer on the counter.<br> I noticed that Bonny had left the glass with the mysterious drink on the floor, where the corpse had lain. No one seemed to pay any further attention to it.";
        }
    }
