    public static string Adv_DoPolizist_Person_I_5101
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "\"Ich habe hier eine einstweilige Verfügung gegen dich, weil du zum Umsturz gegen König Phoney aufrufst!\" rief der Polizist und hielt der Ex-Königin einen Zettel unter die Nase.";
            else
                return "\"I have a restraining order here against you for calling for a coup against King Phoney!\" the policeman shouted and held a piece of paper under the ex-queen's nose.";
        }
    }
    public static string Adv_DoPolizist_Person_I_5102
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "\"Also, das ist ja wohl... Der Kerl sitzt auf MEINEM Thron\" wütete die Exmonarchin.";
            else
                return "\"Well, that's just.... That guy is sitting on MY throne!\" raged the ex-monarch.";
        }
    }
    public static string Adv_DoPolizist_Person_I_5103
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "\"Dein Thron? Möchtest du eine Diebstahlanzeige machen?\" fragte der Polizist lauernd.";
            else
                return "\"Your throne? Do you want to file a theft report?\" the policeman asked lurkingly.";
        }
    }
    public static string Adv_DoPolizist_Person_I_5104
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "\"JA! NEIN! Nein, verdammt nochmal, der Kerl sitzt ja doch am längeren Hebel!\" fauchte die Exmonarchin.";
            else
                return "\"YES! NO! No, damn it, the guy has the upper hand!\" hissed the ex-monarch.";
        }
    }
    public static string Adv_DoPolizist_Person_I_5105
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "\"Ich würde dann jetzt endlich die Hütte durchsuchen. Spricht irgendwas dagegen?\" fragte der Polizist entnervt.";
            else
                return "\"I would then finally search the hut. Is there anything wrong with that?\" the policeman asked, exasperated.";
        }
    }
    public static string Adv_DoPolizist_Person_I_5106
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "\"Ach, tatsächlich? Warum? Wieso? Was gibt dir dazu das Recht?\" fauchte die Exmonarchin. \"Ich plane keinerlei Umsturz gegen Pseudokönig Phoney, und wenn, würde ich jedes Körperteil einzeln guillotinieren.\"";
            else
                return "\"Oh, really? Why? Why? What gives you the right to do that?\" hissed the ex-monarch. \"I don't plan any overthrow against pseudo-king Phoney, and if I did, I would guillotine every body part one by one.\"";
        }
    }
    public static string Adv_DoPolizist_Person_I_5107
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "\"Tja, wer gibt mir das Recht, Herr Specht?\" reimte der Polizist entnervt. \"Völlig egal. Ich durchsuche jetzt die Hütte. Bleib solange hier draußen.\"";
            else
                return "\"Well, who gives me the right?\" said the policeman, exasperated. \"It doesn't matter. I'm going to search the hut. Stay out here until I do.\"";
        }
    }
    public static string Adv_DoPolizist_Person_I_5108
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Der Polizist schaute bedächtig in jede Ecke, bemerkte die Dartscheibe hinter der Tür, die Flugblätter in der Schublade und die Briefe im Fach des Sekretärs. \"Da brat mir doch einer einen Storch\", brummte er beeindruckt vor sich hin, während er die Beweismaterialien einsteckte. Warum auch immer man einen Storch braten sollte.";
            else
                return "The policeman looked thoughtfully in every corner, noting the dartboard behind the door, the pamphlets in the drawer, and the letters in the secretary's drawer. \"Somebody fry me a stork\", he muttered to himself, impressed, as he pocketed the evidence.Whatever the reason for frying a stork.";
        }
    }
    public static string Adv_DoPolizist_Person_I_5109
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Der Polizist musterte Ex-Königin Kate bedächtig. \"Ich habe wirklich jede Menge Beweise gefunden, dass du so einiges auf dem Kerbholz hast. Also so das Übliche an Beweisen. Gefälschte Briefe, gefälschte Flugblätter und schon wieder die Dartscheibe mit Phoney drauf, die Middlefinger schon vor einigen Wochen verwendet hat, um jemanden zu diskreditieren. Sehr fadenscheinige Beweise, aber für einen Schauprozess gegen dich wirds reichen, die Geschworenen sind eh alle bestochen.\"<br>Dann ließ er die kalkweiß aussehende Ex-Königin stehen und ging davon.";
            else
                return "The policeman eyed ex-Queen Kate thoughtfully. \"I really found a lot of evidence that you have a lot on your plate. So the usual evidence. Fake letters, fake flyers, and again the dartboard with Phoney on it that Middlefinger already used to discredit someone a few weeks ago. Very flimsy evidence, but it will be enough for a show trial against you, the jury is all bribed anyway.\"<br>Then he left the chalk-white looking ex-queen standing and walked away.";
        }
    }
