    public static string Adv_DoPolizist_Person_I_5128
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Von drinnen hörte ich den hysterischen Postbeamten: \"Ich habe eine Geisel!\"<br>\"Eine Geisel am Arsch\", knurrte der Polizist durch das Megaphon, stellte es auf der Straße ab und ging breitbeinig in das Kommunikationszentrum.";
            else
                return "From inside, I heard the hysterical postal worker: \"I've got a hostage!\"<br>\"A hostage on my ass\", the policeman growled through the megaphone, set it down in the street, and walked wide-legged into the communications center.";
        }
    }
    public static string Adv_DoPolizist_Person_I_5129
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Drinnen ertönten wilde Schreie, ich hörte den Postbeamten aufjaulen, dann kam er - grün und blau geschlagen und in Handschellen - aus dem Gebäude. Hinterdrein kam der Polizist und knurrte: \"Eine falsche Bewegung und du bist Mus.\"";
            else
                return "Inside, wild screams rang out, I heard the postal worker yelp, then he came out of the building - beaten green and blue and in handcuffs. Behind him came the policeman and growled: \"One wrong move and you're mush.\"";
        }
    }
    public static string Adv_DoPolizist_Person_I_5130
    {
