    public static string Adv_DoPolizist_Person_I_5133
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Karl Lagerhaus musterte den Polizisten erstaunt. \"Das ist doch alles ein ordentlich Sümmchen, findest du nicht?\"<br>\"Äh, nein? Also wenn ich was für dich regeln soll, dann bräuchte ich mindestens das Fünffache. Her damit, sonst gibt's Ärger. Ich bewege mich doch nicht zum Spaß aus meinem Büro heraus.\"";
            else
                return "Karl Lagerhouse looked at the policeman in amazement. \"That's a tidy sum, don't you think?\"<br>\"Uh, no? Well, if you want me to settle something for you, I would need at least five times as much. Give it to me, or there'll be trouble. I'm not moving out of my office for the fun of it.\"";
        }
    }
    public static string Adv_DoPolizist_Person_I_5134
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "\"Und wenn nicht? Willst du mich dann etwa verhaften?\" fragte Karl Lagerhaus trotzig.<br>\"Bingo!\" entgegnete Dirty Larry. \"Im Namen des Gesetzes! Mitkommen\". Er führte den protestierenden Karl Lagerhaus ab.";
            else
                return "\"And if not? Are you going to arrest me then?\" Karl Lagerhouse asked defiantly.<br>\"Bingo!\" Filthy Larry replied. \"In the name of the law! Come along\". He led the protesting Karl Lagerhouse away.";
        }
    }
    public static string Adv_DoPolizist_Person_I_5135
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "\"Dich sperre ich jetzt erst mal ein. Melde dich, wenn du dir überlegt hast, wo du die ganze Kohle versteckt hast.\" sagte Dirty Larry, öffnete einen Schacht mit der Aufschrift \"Gefangene\" und stieß den Lagerverwalter hinein. Mit einem gellenden Schrei verschwand dieser, vermutlich auf Nimmerwiedersehen.";
            else
                return "\"I'm going to lock you up for now. Call me when you've figured out where you hid all the money\", said Filthy Larry, opening a shaft labeled \"Prisoner\" and shoving the storehouse manager inside. With a shriek he disappeared, presumably never to be seen again.";
        }
    }
