                return "\"Dann will ich mal sehen, was ich habe\", sagte Dirty Larry, öffnete den schweren Aktenschrank und nahm eine Akte heraus. \"Ah, und da sind auch die Beweismittel, allen voran die besagte Eisenstange. Sieht alles in bester Ordnung aus.\" ";
