    public static string Adv_DoLagerverwalter_Person_I_5176
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "<br>Karl Lagerhaus starrte verblüfft auf einen leeren Zettel an einer der Frachtkisten. Danach fiel ihm auf, dass alle Frachtbögen unbeschrieben waren.<br>\"Stimmt was mit meinem Permanentmarker nicht? Das ist doch nicht etwa einer von diesen Billigdingern, wo die Farbe sofort verblasst?\" fluchte er, während er nach und nach die Frachtpapiere neu mit dem Permanentmarker beschrieb. Mit sehr unzufriedener Miene schloss er diese Arbeit schließlich ab und legte den Permanentmarker zurück in den Stifthalter.";
            else
                return "<br>Karl Lagerhouse stared in amazement at a blank slip of paper on one of the cargo boxes. Then he noticed that all the freight sheets were blank.<br>\"Is something wrong with my permanent marker? It's not one of those cheap things where the color fades immediately?\" he cursed, while he gradually rewrote the freight papers with the permanent marker. With a very dissatisfied look on his face, he finally finished the job and put the permanent marker back in the pen holder.";
        }
    }
    public static string Adv_DoLagerverwalter_Person_I_5177
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "<br>Karl Lagerhaus starrte verblüfft auf einen leeren Zettel an einer der Frachtkisten. Danach fiel ihm auf, dass schon wieder alle Frachtbögen unbeschrieben waren.<br>\"Was ist mit diesem verdammten Permanentmarker los? Die Schrift ist so gründlich verblasst, dass man nicht mal mehr einen Schatten davon sieht!\" fluchte er, als er nach und nach die Frachtpapiere ein zweites Mal neu beschrieb. Mit sehr unzufriedener Miene schloss er diese Arbeit schließlich ab und legte den Permanentmarker zurück in den Stifthalter.";
            else
                return "<br>Karl Lagerhouse stared in amazement at a blank slip of paper on one of the cargo boxes. Then he noticed that all the freight sheets were blank again.<br>\"What's wrong with this damn permanent marker? The writing has faded so thoroughly that you can't even see a shadow of it!\" he cursed as he gradually rewrote the cargo papers a second time. With a very dissatisfied expression, he finally finished the job and put the permanent marker back in the pen holder.";
        }
    }
    public static string Adv_DoLagerverwalter_Person_I_5178
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "<br>Karl Lagerhaus starrte verblüfft auf einen leeren Zettel an einer der Frachtkisten. Danach fiel ihm auf, dass schon wieder alle Frachtbögen unbeschrieben waren.<br>\"Was ist mit diesem verdammten Permanentmarker los? So kann ich verdammt nochmal nicht arbeiten!\" fluchte er, betrachtete den Stift von allen Seiten und warf ihn schließlich in den Mülleimer. Mit sehr unzufriedener Miene setzte er seinen Rundgang fort.";
