    public static string Adv_DoLandvermesser_Person_I_5291
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "\"Ich habe es mir schlimmer vorgestellt\", gestand er frei heraus. \"Ich dachte, ich kriege hier nasse Füße, aber davon merke ich nichts. So nass kann es gar nicht sein.\"";
