                return "\"Und von irgendwelchen Sumpfgasen riechst du sicher auch nichts!\" sagte ich. Er schüttelte den Kopf. \"Alles nicht so schlimm wie gedacht. Aber das Dumme ist, ich sehe so wenig. Diese hellen Flecken sind ja sicherlich keine Gasflämmchen, oder?\" ";
