    public static string Adv_DoLandvermesser_Person_I_5301
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "\"Und, was hast du herausgefunden? Mein Grundstück gäbe einen wundervollen Golfplatz ab, nicht wahr?\" fragte Deborah den Landvermesser streng.<br>\"Ähm, in der Tat. Ich bin angemessen beeindruckt!\" räumte George Ruler ein.<br>\"Ich gestehe es unumwunden: Ich war voreingenommen! Ich habe Sumpfland mit selbstentzündliche Gasen erwartet. Und dann stoße ich auf dieses grundsolide Stück Land. Ich werde diesen Umstand schonungslos selbstkritisch in meinem Bericht erwähnen!\"";
            else
                return "\"So, what did you find out? My property would make a wonderful golf course, wouldn't it?\" Deborah asked the surveyor sternly.<br>\"Um, indeed. I'm suitably impressed!\" George Ruler conceded.<br>\"I confess it bluntly: I was biased! I was expecting swampland with spontaneously combustible gases. And then I come across this rock-solid piece of land. I will mention this fact relentlessly self-critical in my report!\"";
        }
    }
    public static string Adv_DoLandvermesser_Person_I_5302
    {
        get
