            else
                return "Euphoric, George Ruler waddled away in his wetsuit pants, with his goggles made of window glass and completely deprived of his sense of smell.";
        }
    }
    public static string Adv_DoLandvermesser_Person_I_5303
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "\"Grundsolide? Das ist ein Paradies! Einen besseren Ort wirst du auf der ganzen Insel nicht finden. Ich hab es gleich gesagt! Dafür schuldest du mir Abbitte! Oder am Besten sogar Schadensersatz wegen übler Nachrede!\" ereiferte sich Deborah.<br>George Ruler rieb sich in aller Gelassenheit das Kinn.<br>\"Nun übertreib nicht gleich. Und überhaupt: Ich schulde Herrn Middlefinger ein Gutachten, und sonst gar nichts. Ach ja, doch: Dann schulde ich mir einen weiteren ordentlichen Drink\", stellte er fest. \"Oder warte... besser zwei.\"<br>Dann watschelte er in seiner Taucheranzughose davon.";
            else
                return "\"Basic solid? This is a paradise! You won't find a better place on the whole island. I told you so! You owe me an apology for that! Or best of all, you owe me damages for defamation!\" Deborah was furious.<br> George Ruler rubbed his chin calmly.<br>\"Don't exaggerate. And anyway: I owe Mr. Middlefinger an expert opinion, and nothing else. Oh, yes: then I owe myself another proper drink\" he stated. \"Or wait... better two.\"<br>Then he waddled off in his wetsuit pants.";
        }
    }
