    public static string Adv_DoKuechenchefin_Person_I_5399
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Die Küchenchefin baute sich drohend vor Tony Freshman auf. \"Ich sage dies nur dieses eine Mal!\" sagte sie gefährlich leise. \"Dieser Rüpel auf dem Thron verlangt Bohnen, Erbsen und Mais, und er wird sie bekommen. Mir völlig egal, wo du sie herbekommst.\"";
            else
