        }
    }
    public static string Adv_DoKuechenchefin_Person_I_5400
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Tony Freshman verschränkte die Arme vor der Brust. \"Keine Chance. Broccoli, Spitzkohl und Artischocke kann ich dir anbieten. Ganz frisch aus dem Gewächshaus. Aber dieses von dir verlangte... Zeug habe ich nicht.\"";
            else
                return "Tony Freshman folded his arms in front of his chest. \"Not a chance. I can offer you broccoli, pointed cabbage and artichoke. Fresh from the greenhouse. But this stuff you're asking for... I don't have that stuff.";
        }
    }
    public static string Adv_DoKuechenchefin_Person_I_5401
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "\"Du hörst nicht zu, Tony. Letzte Chance\", sagte die Küchenchefin gefährlich leise. \"Ich weiß sehr wohl, dass du deine geheimen Quellen hast. Aktiviere sie, oder ich sorge dafür, dass du fliegst. Haben wir uns verstanden?\"";
            else
                return "\"You're not listening, Tony. Last chance,\" the chef said dangerously softly. \"I know very well that you have your secret sources. Activate them, or I'll make sure you get kicked out. Are we clear?\"";
        }
    }
    public static string Adv_DoKuechenchefin_Person_I_5402
