    public static string Adv_DoKuechenchefin_Person_I_5403
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Die Küchenchefin stand am Herd und rührte murrend in einem Topf herum. \"Soll er doch verrecken an diesem Fraß\", knurrte sie unerbittlich.<br>Sie füllte den Inhalt des Topfes in eine Servierschüssel und deckte diese ab.";
            else
                return "The chef stood at the stove and stirred grumbling in a pot around. \"Let him but die of this grub\", she growled implacably.<br>She filled the contents of the pot into a serving bowl and covered it.";
        }
    }
    public static string Adv_DoKuechenchefin_Person_I_5404
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return " \"Was ist das?\" schrie Phoneys entsetzt. \"Das ist ja... Gemüse! Ich habe nichts mit Gemüse bestellt. Das Zeug ist widerlich und ekelhaft! Schon gar keine Bohnen! Nimm diesen Fraß wieder mit! Brat mir mal lieber wieder einen anständigen Burger.\"<br>\"Aber, aber... Äh, jawohl, Euro Durchlaucht\", stammelte Toya völlig konsterniert und nahm den Topf wieder an sich.";
            else
                return " \"What is this?\" Phoneys cried out in horror. \"These are... vegetables! I didn't order anything with vegetables. That stuff is disgusting and gross! Especially not beans! Take that crap back! You better fry me a decent burger again.\"<br>\"But, but.... Uh, yes, Your Highness,\" Toya stammered in total consternation and took the pot back.";
        }
    }
    public static string Adv_DoKuechenchefin_Person_I_5405
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return " \"Du hast mich ja schön reingeritten!\" blaffte mich Toya.<br>\"Wovon redest du?\" fragte ich erstaunt.<br>\"Na, du hast mir doch gesagt, dass Phoney ein Gericht aus Bohnen, Mais und Erbsen verlangt!\"<br>\"Aber niemals habe ich das getan. Warum sollte ich so etwas verrücktes tun? Du musst geträumt haben!\"<br>\"Geträumt?\" Toya Tortilla starrte mich entsetzt an. \"Oh mein Gott, ich bin hoffentlich nicht wieder im Stehen eingeschlafen und habe wer weiß was geträumt.\" ";
            else
                return " \"You've got me all worked up!\" Toya barked at me.<br>\"What are you talking about?\" I asked in amazement.<br>\"Well, you told me that Phoney asked for a dish of beans, corn and peas!\"<br>\"But I never did that. Why would I do something so crazy? You must have been dreaming!\"<br>\"Dreaming?\" Toya Tortilla stared at me in horror. \"Oh my God, I hope I didn't fall asleep standing up again and dream who knows what.\" ";
        }
    }
