    public static string Adv_DoGhoul_Person_I_5580
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Die Tür schwang auf und eine widerliche Gestalt erschien, ein Wesen, halb Mensch... halb Ghul. Er musterte mich hungrig.<br>\"Ich soll dich... essen\", sagte es zu meinem eisigen Schrecken.<br>Dann kratzte es sich verlegen am Kopf.<br>\"Wo bin ich bloß mit meinen Gedanken? Ich bin wohl mal wieder zu hungrig. Aber gut, eigentlich bin ich ja immer hungrig. Ich soll dich verhören. Ich werde die Wahrheit schon aus dir herausbekommen, du Halunke.\"<br><br>";
