    public static string Adv_DoGhoul_Person_I_5590
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Der Ghul blickte mich an. \"Du bist ja immer noch hier!\"<br>Ich fluchte innerlich. Scaramango hätte noch so viele wichtige Informationen für mich gehabt. Aber jetzt ich wohl sehen, dass ich hier ganz schnell verschwand.\"Ich wollte gerade gehen\", säuselte ich und wandte mich zur Treppe.<br>\"Bestens!\" knarrte der Ghul.<br>Dann wandte er sich Scaramango zu. \"Wird Zeit, dass du wieder in deine Zelle kommst.\" Dann schloss er die Zelle auf und steckte Scaramango hinein. \"Ich will einen Anwalt, der mich nicht aufessen will\", waren seine letzte Worte, bevor die schwere Tür zufiel.<br>Seufzend wandte ich mich ab. Ich musste einen neuen Weg ersinenn, zu Scaramango vorzudringen.";
            else
                return "The ghoul glared at me. \"You're still here!\"<br>I cursed inwardly. Scaramango would have had so much important information for me. But now I guess I'll see that I get out of here real quick.<br>\"I was just leaving,<br>\"I purred, turning toward the stairs.<br>\"Fine!\" the ghoul creaked.<br>Then he turned to Scaramango. <br>\"About time you got back to your cell.<br>\"Then he unlocked the cell and put Scaramango inside. \"I want a lawyer who won't eat me up\", were his last words before the heavy door slammed shut.<br>Sighing, I turned away. I had to think of a new way to get to Scaramango.";
        }
    }
