    public static string Order_ZauberspiegelDoEnter_Person_Everyone_5711
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Als mein Körper die Oberfläche berührte, fühlte es sich an, wie in eine ölige Flüssigkeit einzutauchen. Ich bewegte mich in das Wabern hinein... und...und...<br><br><br>... Funken flogen, ein elektrisches Britzeln ertönte. Eine leise Frauenstimme verkündete mechanisch: 'Fehlfunktion. Bitte rufen Sie den Kundendienst unter...' Der Rest wurde von Störgeräuschen übertönt.<br><br>Ich stürzte ins Nichts. Unmittelbar befand ich mich im freien Fall. Tief unter mir erkannte ich die Konturen einer Insel, die in atemberaubender Geschwindigkeit näher kam. Kurz darauf erkannte ich einen großen Platz, auf dem zahlreiche Leute in seltsamen heruntergekommenen Lumpen herumstanden. Mit jedem Sekundenbruchteil, der verstrich, kam der Boden näher. ";
            else
                return "When my body touched the surface, it felt like diving into an oily liquid. I moved into the wobble.... And...and...<br><br><br>... Sparks flew, an electric fizzle sounded. A soft female voice mechanically announced, 'Malfunction. Please call customer service at...' The rest was drowned out by noise.<br><br>I plunged into nothingness. Immediately I found myself in free fall. Deep below me I recognized the contours of an island, which was approaching at breathtaking speed. Shortly after, I recognized a large square where numerous people in strange dilapidated rags were standing around. With every fraction of a second that passed, the ground came closer. ";
        }
    }
    public static string Order_ZauberspiegelDoEnter_Person_Everyone_5712
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "<br><br><br>";
            else
                return "<br><br><br>";
        }
    }
    public static string Order_ZauberspiegelDoEnter_Person_Everyone_5713
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "<br/><br/><br/>\"Hört mich an und schaut auf diesen Unwürdigen!\" rief der König aufgebracht und deutete mit seinem Zepter auf den auf dem Boden knieenden Mann.<br>\"Francesco Scaramango, einst der höchste meiner königlichen Berater, hat ein unverzeihliches Sakrileg begangen! Er hat sich mit den verbotenen Dingen beschäftigt!\" ";
            else
                return "<br/><br/><br/>\"Hear me and look upon this unworthy man!\" the king cried out angrily, pointing his scepter at the man kneeling on the ground.<br>\"Francesco Scaramango, once the highest of my royal advisors, has committed an unforgivable sacrilege! He has engaged in the forbidden things!\" ";
        }
    }
    public static string Order_ZauberspiegelDoEnter_Person_Everyone_5714
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Ein entsetztes Raunen ging durch die Menge, die sich unter dem Felsenbalkon versammelt hatte.<br>\"Ja, ich scheue mich nicht, dieses schändliche Verbrechen beim Namen zu nennen. Er hat sich mit Fakten beschäftigt. Mit FAKTEN!\"<br>Die Menge geriet mehr und mehr außer sich.<br>\"Und das Unverzeihlichste: Er hat sie ausgesprochen. Er hat diese Dinge euch gegenüber ausgesprochen. Er hat euch mit etwas behelligt, vor dem ihr so lange verschont geblieben seid, dank mir. Der WAHRHEIT!\"<br>Abermals ging ein gequältes Raunen durch die Menschenmassen.<br>\"Ich weiß, viele von euch sind nun traumatisiert, aber ich verspreche euch: Scaramango wird für seine Taten bezahlen. Der Allmächtige selbst möge mir ein Zeichen geben, wie mit Scaramango zu verfahren sei.\"<br>Der König reckte die Hände gen Himmel, schloss die Augen und harrte der göttlichen Botschaft.<br><br>";
            else
                return "A horrified murmur went through the crowd that had gathered under the rocky balcony.<br>\"Yes, I am not afraid to call this shameful crime by its name. He was dealing with facts. With FACTS!\"<br>The crowd became more and more enraged.<br>\"And the most unforgivable thing: He has spoken them. He has spoken these things to you. He has bothered you with something you have been spared for so long, thanks to me. The TRUTH!\"<br>Once again, an agonized murmur went through the crowds.<br>\"I know many of you are traumatized now, but I promise you: Scaramango will pay for his actions. May the Almighty Himself give me a sign of how to deal with Scaramango.\"<br>The king raised his hands to heaven, closed his eyes and awaited the divine message.<br><br>";
        }
    }
    public static string Order_ZauberspiegelDoEnter_Person_Everyone_5715
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "In diesem Moment stürzte ein schlaffer Körper vom Himmel direkt auf den sündigen Berater und begrub ihn unter sich. Was immer dieser Berater auch für ein Lump gewesen war, heute rettete er mir das Leben, indem er meinen Sturz bremste.<br>Denn dieser schlaffe Körper - das war ich. Ich riss den Berater um und landete neben ihm auf dem Boden. Jeder einzelne Knochen schmerzte, während ich ihn abtastete. Aber ich war unfassbarerweise noch am Leben! Ich atmete tief durch und rappelte mich mühsam auf.<br>";
            else
                return "At that moment, a limp body fell from heaven directly onto the sinful counselor, burying him underneath. Whatever that counselor had been, today he saved my life by breaking my fall.<br>For that limp body - that was me. I knocked the consultant over and landed on the ground next to him. Every bone ached as I palpated it. But, inconceivably, I was still alive! I took a deep breath and struggled to get up.<br>";
        }
    }
    public static string Order_ZauberspiegelDoEnter_Person_Everyone_5716
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Der König blickte mich erstaunt an - und ich glotzte vermutlich ebenso verwirrt zurück.<br>\"Der Letzte, der hier vom Himmel fiel, war ich selbst - vor zehn Jahren. Du kommst nicht zufällig auch aus einer anderen Dimension?\" <br>Meine Gedanken überschlugen sich. Ich hatte niemand anderen als den gesuchten Phoney vor mir! Dieses Dimensionstor hatte offensichtlich Raum und Zeit ordentlich durcheinander gewirbelt, mal wieder zu Phoneys Gunsten. Dass er seinen zeitlichen Vorsprung genutzt hatte, um sich hier zum Herrscher aufzuschwingen, erstaunte mich wenig. Es war einfach nicht auszuhalten, wie die Leute jedesmal wieder auf ihn hereinfielen.<br>Und da lag mein nächstes Problem. Er hatte diese Leute offensichtlich alle unter seiner Fuchtel.";
            else
                return "The king looked at me in amazement - and I probably stared back just as confused.<br>\"The last one to fall from the sky here was myself - ten years ago. You don't happen to be from another dimension either?\" <br>My thoughts were racing. I was looking at none other than the Phoney I was looking for! This dimension gate had obviously whirled space and time, once again in Phoney's favor. That he had used his head start in time to become the ruler here, surprised me little. It was simply unbearable how people fell for him again and again.<br>And there was my next problem. He had all these people obviously under his thumb.";
        }
    }
    public static string Order_ZauberspiegelDoEnter_Person_Everyone_5717
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Er richtete sich zu seiner vollen zwergenhaften Gestalt auf, klatschte in die Hände und rief:<br>\"Wachen! Diese beiden sind des schweren Frevels angeklagt! Bringt sie in den Kerker!\"<br><br>Feste Arme griffen nach mir und schleiften mich davon. Rücksichtslos zerrte man mich durch die Gänge und über die Treppen eines mittelalterlichen Gemäuers. Am Ende warf man mich in eine Zelle. Eine bizarre Gestalt erschien, ein Wesen, das wie ein leichenfressender Ghul aussah. Es musterte mich mit fragwürdigem Blick und sagte: \"Um dich kümmern wir uns später.\"<br>Dann wandte sich der Ghul ab. Kurz darauf hörte ich, wie eine weitere Zellentür zuschlug. Von nebenan hörte ich das dumpfe Gezeter des in Ungnade gefallenen Beraters.";
            else
                return "He straightened to his full dwarfish stature, clapped his hands and shouted:<br>\"Guards! These two are accused of grave sacrilege! Take them to the dungeon!\"<br><br>Firm arms grabbed me and dragged me away. Ruthlessly they dragged me through the corridors and up the stairs of a medieval masonry. In the end, they threw me into a cell. A bizarre figure appeared, a creature that looked like a corpse-eating ghoul. It eyed me with a questionable look and said: \"We'll take care of you later.\"<br>Then the ghoul turned away. Shortly after, I heard another cell door slam shut. From next door I heard the muffled clamor of the disgraced advisor.";
        }
    }
