    public static string Order_StartTribunal_13375
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Todesmutig trat ich vor die Massen und begann zu sprechen.<br>\"Wir sind heute hier zusammen gekommen, um der Wahrheit zum Sieg zu verhelfen! Nicht irgendeiner Wahrheit, nein, UNSERER Wahrheit! Schluss mit all den Lügen, die unsere Feinde verbreiten, um König Phoney in den Schmutz zu ziehen! Heute kommt UNSERE Wahrheit ans Licht! Und diese lautet...";
            else
                return "Deathly courageous I stepped in front of the masses and began to speak.<br>\"We are gathered here today to help the truth to victory! Not just any truth, no, OUR truth! No more of all the lies our enemies spread to drag King Phoney through the mud! Today OUR truth comes to light! And this is...";
        }
    }
    public static string Order_StartTribunal_13376
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Die ganze Zeit treibt Ex-Königin Kate ein schändliches Spiel. Trotz der schieren Gnade, dass König Phoney sie nach dem Pu.... ihrer Entlassung nicht hat köpfen lassen, hintertreibt sie seine Herrschaft und zieht sein Ansehen in den Dreck. Und dafür... dafür haben wir Beweise!\" brüllte ich voller Triumpf in den Talkessel. Das Publikum jauchzte wohlig.";
            else
                return "All the while, ex-Queen Kate is playing a nefarious game. Despite the sheer grace that King Phoney didn't have her beheaded after her of her dismissal, she is betraying his reign and dragging his reputation through the mud. And for this... For this we have proof!\" I roared full of triumph into the valley cauldron. The audience cheered with delight.";
        }
    }
