    public static string Order_Go_I00_Karren_13384
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "<br>Schon als ich mich der offenen Kellertür näherte, ahnte ich, dass hier etwas ganz und gar nicht normal war. Und tatsächlich: Ein Teil der Wand glomm im fahlen Licht.<br>Ich trat näher heran und erkannte, dass dort ein mannshoher Spiegel an der Wand befestigt war, der von innen heraus leuchtete.<br>Nun glaubte ich ja eigentlich nicht an Magie, aber ich erkannte einen Zauberspiegel, wenn ich einen sah!";
            else
