    public static string Order_Go_I1_43_Blaetter_13507
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Als ich das Gewölbe sah, war mir sofort klar, dass Erins Plan gar nicht so schlecht war. Der Ofen war riesig und eine große Menge Kohle lag bereit. Wenn man sich nicht gerade an der miesen CO²-Bilanz störte, konnte man den Raum in eine echte Vorhölle verwandeln. Eigentlich fehlte dann nur noch eine nette Höllendeko und natürlich eine verrammelte Tür. Ach ja, und dann noch die spezielle Akustik, die Erin haben wollte. Aber darum sollte sie sich gefälligst selbst kümmern.";
            else
                return "When I saw the vault, I immediately realized that Erin's plan was not so bad. The oven was huge and a large amount of coal was ready. If you didn't mind the lousy CO² balance, you could turn the room into a real limbo. Actually, the only thing missing was a nice hell decoration and, of course, a barricaded door. Oh yes, and then the special acoustics that Erin wanted. But she should take care of that herself.";
        }
    }
