    public static string MAUI_Phoney_Generell
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Dieses Spiel ist vollständig kostenlos und kann gerne und jederzeit frei weitergegeben werden. Solltest du der Meinung sein, dass der Spielspaß, den du beim Spielen dieses Spiels hattest, ein paar Dollar oder Euro wert ist, dann folge dem PayPal-Link unten. Die Höhe deiner Spende ist völlig unerheblich, ich freue mich in jedem Fall über die Anerkennung!\n\n\n";
            else
                return "This game is completely free and can be shared freely at any time. If you think the fun you had playing this game is worth a few dollars or euros, follow the PayPal link below. The amount of your donation is completely irrelevant, I appreciate the recognition in any case!\n\n\n";
        }
    }
    public static string MAUI_Phoney_Translation
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Die englische Übersetzung aus dem deutschen Original wurde mit DeepL und viel Handarbeit erstellt. Sie ist sicherlich weit davon entfernt, perfekt zu sein. Wenn du etwas siehst, das lektoriert werden sollte, kann du mit einer Eingabe '# bla bla bla' nicht nur Kommentare zum Spiel hinterlassen, sondern auch zur Übersetzung. Wie diese Hinweise zu mir kommen, steht weiter unten. Ich bin in jedem Fall dankbar für jede Hilfe, die ich bekommen kann.\n\n\n";
            else
                return "The English translation from the German original was created with DeepL and a lot of manual work. It is certainly far from perfect. If you see something that should be proofread, you can leave comments not only about the game but also about the translation by typing '# bla bla bla'. How these comments come to me is explained below. In any case, I'm grateful for any help I can get.\n\n\n";
        }
    }
    public static string MAUI_Phoney_Grafik
    {
        get
        {
            if (_gd!.Language == IGlobalData.language.german)
                return "Wichtig: Die im Spiel gezeigten Illustrationen sind nur insofern mein Werk, als dass ich die Beschreibungen als Prompt bei Midjourney eingegeben habe. Weil ich die Ergebnisse mag und sie durchaus inspirierend finde, habe ich sie ins Spiel eingebaut. Ein integraler oder notwendiger Bestandteil des Spiels sind sie nicht, deshalb sind sie per Default abgeschaltet. Wenn du KI-Art nicht unterstützen möchtest oder ein anderes Problem damit hast, dann schalte sie mit \"Illustration aus\" einfach wieder ab. Außer den Illustrationen entgehen dir dabei keine Spielinhalte und das Spiel ist ohne Illustrationen genauso gut lösbar wie mit.\n\n\n";
            else
                return "Important: The illustrations shown in the game are only my work insofar as I entered the descriptions as prompts in Midjourney. Because I like the results and find them quite inspiring, I have included them in the game. They are not an integral or necessary part of the game, so they are turned off by default. If you don't want to support AI art or have another problem with it, simply switch it off again with \"Illustration off\". Apart from the illustrations, you will not miss out on any game content and the game is just as easy to solve without illustrations as with.\n\n\n";
        }

    }
